import React, { Component } from 'react';

export default class Explanation extends Component {
  render() {
    if (this.props.currPage === 'detox') {
      <span className="explnation">
        A course program that organizes all the cleanser programs of Mercy
        Juice, which are specialized in excellent cleansing effects and balanced
        nutritional supply, in a step-by-step manner to achieve a more balanced
        and effective process.
      </span>;
    } else if (this.props.currPage === 'powder') {
      <span className="explnation">
        A course program that organizes all the cleanser programs of Mercy
        Juice, which are specialized in excellent cleansing effects and balanced
        nutritional supply, in a step-by-step manner to achieve a more balanced
        and effective process.
      </span>;
    } else {
      <span className="explnation">
        A course program that organizes all the cleanser programs of Mercy
        Juice, which are specialized in excellent cleansing effects and balanced
        nutritional supply, in a step-by-step manner to achieve a more balanced
        and effective process.
      </span>;
    }

    return (
      <span className="explnation">
        A course program that organizes all the cleanser programs of Mercy
        Juice, which are specialized in excellent cleansing effects and balanced
        nutritional supply, in a step-by-step manner to achieve a more balanced
        and effective process.
      </span>
    );
  }
}
